import { Project, ProjectSet } from "../DoData";

export const projectStore = (
    project: Project,
    allProjects: ProjectSet,
    setStore: (data: ProjectSet) => void
) => {
    if (project.text.length < 1) {
        allProjects.projects.push(project)
        setStore(allProjects)
    }
}
